(110, 'FB 0213', 'chat', 'FRANCE S DAMAS', 'text', 'FRANCE S DAMAS', 'A flipped classroom is a type of blended learning where students are introduced to content at home and practice working through it at school.', '2020-12-16 07:38:44', ''),
(111, 'FB 0213', 'chat', 'FRANCE S DAMAS', 'text', 'FRANCE S DAMAS', '2. Biology has many concepts which needs proper illustration, explanation and practical. Flipped classroom involves using online tools for pre-class interaction between the learner and the subject matter.', '2020-12-16 07:43:01', ''),
