(113, 'FB 0213', 'chat', 'DEODATUS KALEKONA', 'text', 'DEODATUS KALEKONA', 'Flipped model of learning give learners  enough time to make their assessments on what they have taught during class hours and give them to know what part of subject they have mastered or what they have failed to master and they can use their own time to learn more when they are at home or outside of the class ', '2020-12-16 07:47:29', ''),
