(126, 'FB 0213', 'chat', 'Hamadi Mtani', 'text', 'Hamadi Mtani', '4. What are the challnges of using online education environment.', '2020-12-19 08:01:58', ''),
(131, 'FB 0213', 'chat', 'DEODATUS KALEKONA', 'text', 'DEODATUS KALEKONA', 'online learning becomes difficult to most students/learners due to lack of enough material access facilities like high speed network ie 4G+ and 5G, lack of modern computers ie advanced mobile phones, tablets and white board, but also having poor knowledge on the use of online learning pratforms.', '2020-12-21 06:08:31', ''),
(132, 'FB 0213', 'chat', 'WILLIAM BUSHI', 'text', 'WILLIAM BUSHI', 'Online learning can be faced by the following challenges, Adaptability, Technical issue,computer knowledge, time management,self motivation, distraction and learning style', '2020-12-21 06:15:28', ''),
(133, 'FB 0213', 'chat', 'ELIZABETH ILANGA MAGEME', 'text', 'ELIZABETH ILANGA MAGEME', 'The most challange  to online education it is technical issues,as online students you can access class wherever you have a connected device, but a strong internet connection is requred ,also through low bandwidth and weak internet can affect how you can connect and participate in class', '2020-12-21 06:15:36', ''),
(136, 'FB 0213', 'chat', 'JUMA MASAITE', 'text', 'JUMA MASAITE', ' Online Learning Challenges â€“ Computer Knowledge   Lack of computer education is a major concern in todayâ€™s world. There are many students who still cannot operate basic computers with MS word and PowerPoint. And whenever some technical issues emerge, they find it difficult to solve the problem in such a scenario. They face difficulties with live classes, usage of appropriate icons, MS office, communication-related apps and websites, browsing study materials, etc. Sometimes they do not know technology proficiency like login, live classes, creating and submitting work, communicating with teachers and friends. ', '2020-12-21 06:21:27', ''),
(137, 'FB 0213', 'chat', 'SHAKUBU AYOUB', 'text', 'SHAKUBU AYOUB', 'The following are the challanges of using online education environment ; poor knowledge on using computers and other network devices like smart phone,tablets .also there are some areas which are so very difficult to access the intenet such as in local areas as well as the problem of elecricity,lastly the problem of learning style since every learner has his/her learning style .thanks', '2020-12-21 06:42:01', ''),
(138, 'FB 0213', 'chat', 'ELIZABETH ILANGA MAGEME', 'text', 'ELIZABETH ILANGA MAGEME', 'Another  challenge to online education is Digital literacy. To attend class online ,you will need a certain degree of technological proficiency including the ability to successfully log in,participate in classess,submit work, and communicate with teachers and classmates .This includes understanding online communication etiquette and knowing student rights and responsibilities in online learning environment, also if there is low technology it is become difficult to participate in online education.', '2020-12-21 06:48:13', ''),
(139, 'FB 0213', 'chat', 'SAMWEL OYYE', 'text', 'SAMWEL OYYE', 'Lack of enough devices including laptops/computers as well as tablets among students is one of challenge toward attaining online learning', '2020-12-21 07:00:38', ''),
(141, 'FB 0213', 'chat', 'FRANCE S DAMAS', 'text', 'FRANCE S DAMAS', 'Digital Literacy, Technical Issues, Time Management and Motivation Online learning requires motivation to complete tasks, stay engaged, and make progress.', '2020-12-21 07:25:59', ''),
(142, 'FB 0213', 'chat', 'JACLINA GEOFREY', 'text', 'JACLINA GEOFREY', 'Fliped classroom;is the model where students watch lectures at home on the computer; then in class time is dedicated in discussions and interactive exceses', '2020-12-21 07:29:31', ''),
(146, 'FB 0213', 'chat', 'GEORGE FROLENCE', 'text', 'GEORGE FROLENCE', 'Flipped Model  is a â€œpedagogical approach in which direct instruction moves from the group learning space to the individual learning space, and the resulting group space is transformed into a dynamic, interactive learning environment where the educator guides students as they apply concepts and engage creatively in the subject matterâ€', '2020-12-21 07:32:40', ''),
(147, 'FB 0213', 'chat', 'RAINES DAVID', 'text', 'RAINES DAVID', 'flipped classroom model is the one which students study and whatch  lectures when there at home on the computer then in class time make discussion,interactive exercise also independent work.', '2020-12-21 07:34:08', ''),
(148, 'FB 0213', 'chat', 'GEORGE FROLENCE', 'text', 'GEORGE FROLENCE', '2.  The use of flipping classroom is useful for sure. But in my experience you cannot turn all sessions to become flipped classroom. It is not possible for students and staff. However, you can and you should do such move in postgraduate courses', '2020-12-21 07:35:09', ''),
(149, 'FB 0213', 'chat', 'MODESTA MASEBU', 'text', 'MODESTA MASEBU', 'Online learning can problem in the environment because in need knowledge and technology that support learning  and it involve high cost', '2020-12-21 07:35:15', ''),
(150, 'FB 0213', 'chat', 'GEORGE FROLENCE', 'text', 'GEORGE FROLENCE', 'The common problems faced by students in eLearning classes and which they need to be solved through proper initiatives for the studentsâ€™ future benefits:      Adaptability Struggle.       Switching from traditional classroom and face to face instructor training to computer-based training in a virtual classroom makes the learning experience entirely different for students. Their resistance to change doesnâ€™t allow them to adapt to the online learning environment, whereas it takes time for them to get accustomed to Course Management Systems (CMS) and the methods of computer-based education. While passive listening and notes taking are expected in a traditional classroom, online discussions or creating a web page demand springing into action. Students with a â€œtraditionalâ€ mindset find it difficult to adapt; however, they need to accept the new learning circumstances with an open mind and heart. Understanding the benefits of eLearning and even discussing them with their peers may change this mindset and better prepare students for online classes.     Technical Issues.     Many students are not provided with the high bandwidth or the strong internet connection that online courses require, and thus fail to catch up with their virtual classmates: Their weak monitors make it hard to follow the Course Management System and their learning experience becomes problematic. Moreover, most of them live off campus and find it difficult to keep in tune with the technical requirements of the chosen course. Some of them donâ€™t even own computers and seek help in Learning Resource Centers for technical assistance. The only solution to this problem is knowing exactly what kind of technological support they will need for a certain course before enrolling in it, as well as properly equipping themselves for the courseâ€™s successful completion.     Computer Literacy.     Although students are generally tech savvy, and thus able to manage computers well, lack of computer literacy is a major issue among students today. Many of them cannot operate basic programs such as Microsoft Word and PowerPoint and therefore are not able to handle their files. Furthermore, many students find fixing basic computer problems troublesome, as they have no knowledge in this area. However, technological proficiency is a must for following online courses, as it enables students to manage their assignments and courseware in an organized manner without struggling. Basic courses in computer literacy enhance studentsâ€™ knowledge in the field; having a fundamental knowledge of computer hardware would help them participate in online classes without interruptions and hindrances.     Time Management.     Time management is a difficult task for eLearners, as online courses require a lot of time and intensive work. Furthermore, whereas it is mostly adults who prefer web-based learning programs for their place and time flexibility, they rarely have the time to take the courses due to their various everyday commitments. A regular schedule planner would be a significant help to these learners, as they could even set reminders for their courses and assignments.     Self-Motivation.     Self-motivation is an eLearning essential requirement; however, many online learners lack it, much to their surprise. After enrolling in distance learning courses, many learners fall behind and nurture the idea of giving up, as difficulties in handling a technological medium also seem insurmountable. Students need to find the motivation to follow the new educational trends and also properly equip themselves for future challenges in their education and careers. Only a positive attitude will help them overcome the challenges in eLearning; though this is hard to practice, students need to understand that it is necessary in order to reap the eLearningâ€™s benefits in the future.  eLearning is good news, but at its initial stage it poses certain threats to students. Attitude change and technological literacy would help them gain confidence in order to succeed in their courses with a positive vibe.', '2020-12-21 07:37:42', ''),
(151, 'FB 0213', 'chat', 'SAUDA SENGO', 'text', 'SAUDA SENGO', 'A flipped classroom is a type of blended learning where students are introduced to content at home and practice working through it at school. This is the reverse of the more common practice of introducing new content at school, then assigning homework and projects to completed by the students independently at home.', '2020-12-21 07:39:59', ''),
(152, 'FB 0213', 'chat', 'MODESTA MASEBU', 'text', 'MODESTA MASEBU', 'online learning in the environment is problem because it need knowledge and enough technology like computer', '2020-12-21 07:40:06', ''),
(153, 'FB 0213', 'chat', 'SAUDA SENGO', 'text', 'SAUDA SENGO', 'The results shows that the flipped group performed significantly better than the traditional group in both lower and higher order thinking skills. ... It shows that the flipped classroom significantly increased students\' interest in ', '2020-12-21 07:46:40', ''),
(154, 'FB 0213', 'chat', 'JAMILA JUMANNE HUSSEIN', 'text', 'JAMILA JUMANNE HUSSEIN', '1.Flipped classroom model;is an approach that blends face to face interaction in the classroom with independent study outside of it,often through viewing assigned video content.', '2020-12-21 07:46:57', ''),
(155, 'FB 0213', 'chat', 'JACLINA GEOFREY', 'text', 'JACLINA GEOFREY', 'using flipped classroom have impact to student through increas the students interest in learning biology;also help student to gather data or material;make students more active,interested and partcipative during learning biology', '2020-12-21 07:47:29', ''),
(156, 'FB 0213', 'chat', 'ABUNASRI MOHAMED ABUBAKARI', 'text', 'ABUNASRI MOHAMED ABUBAKARI', 'Flipped classroom:this is the type of learning which aim to increase learner\'s engagement and learning by having learners complete on their home and work on problem solving during class time.', '2020-12-21 07:47:50', ''),
(157, 'FB 0213', 'chat', 'SAUDA SENGO', 'text', 'SAUDA SENGO', 'Technical Issues. Distractions and Time Management. Staying Motivated. Understanding Course Expectations. Lack of In-Person Interaction. Adapting to Unfamiliar Technology. Uncertainty About the Future', '2020-12-21 07:51:50', ''),
(159, 'FB 0213', 'chat', 'ABUNASRI MOHAMED ABUBAKARI', 'text', 'ABUNASRI MOHAMED ABUBAKARI', '2.To learning biology more instruction and illustration needed in order to understanding more deeply, in my views i don\'t see any learning impact in learning biology by using flipped classroom because biology subject need more illustration and practical to understand.', '2020-12-21 07:58:46', ''),
(160, 'FB 0213', 'chat', 'RAINES DAVID', 'text', 'RAINES DAVID', 'flipped classroom help students in learning biology in academic achievement and attitude toward biology also perform better in both higher an lower thinking skill.s', '2020-12-21 08:01:31', ''),
(161, 'FB 0213', 'chat', 'JACLINA GEOFREY', 'text', 'JACLINA GEOFREY', '4.challenges of using online education environment;[a]technical issue    [b]distractions and time managnment    [c] staying motivated   [d] understanding course expectations   ;each one of thesehas an effect on the overall quality of distance learning as a product.', '2020-12-21 08:01:40', ''),
(162, 'FB 0213', 'chat', 'MODESTA MASEBU', 'text', 'MODESTA MASEBU', 'flipped classroom this is the technology application in education that involves lecture and practice  at home or any where via computer-guided instruction  and interactive learning activities  in class  that can allow for an expanded curriculum', '2020-12-21 08:13:59', ''),
(163, 'FB 0213', 'chat', 'RAINES DAVID', 'text', 'RAINES DAVID', 'challanges of using online education environment are lack of good knowledge of using online learning  device like computer, smartphones,tablets; also low access of intenet especially in local areas,also lack of self motivation to learn.', '2020-12-21 08:20:22', ''),
(164, 'FB 0213', 'chat', 'JACLINA GEOFREY', 'text', 'JACLINA GEOFREY', 'Iam enjoying when i use  this system so thank you sir for that idea', '2020-12-21 08:22:47', ''),
(165, 'FB 0213', 'chat', 'ELIZABETH ILANGA MAGEME', 'text', 'ELIZABETH ILANGA MAGEME', 'Flipped classroom is an instructional strategy and a style of blended learning, which aims to increase students engagement and learning having students complete readings at their home and work on live problems solving during class time. ', '2020-12-21 08:31:32', ''),
(166, 'FB 0213', 'chat', 'ELIZABETH ILANGA MAGEME', 'text', 'ELIZABETH ILANGA MAGEME', 'Flipped classroom in biology it become a difficult  learning because it receive different theoretical concept which involve many explanation and different practical.', '2020-12-21 08:53:09', ''),
(167, 'FB 0213', 'chat', 'JAMILA JUMANNE HUSSEIN', 'text', 'JAMILA JUMANNE HUSSEIN', 'Challenges of using online education enviroment are Digital literacy-to attend online classes,you will need a certain degree of of technological proficiency,and these including the ability to successfully log in,participate in classes,submit work and communicate with teachers and classments', '2020-12-21 08:56:25', ''),
(168, 'FB 0213', 'chat', 'MODESTA MASEBU', 'text', 'MODESTA MASEBU', 'The flipped  classsroom will have impact on learning biology because it enable learners or students to make efficiency and better learning  and involve learning  through technology like computers. Also not more useful in many  schoools  ', '2020-12-21 08:59:16', ''),
(169, 'FB 0213', 'chat', 'JAMILA JUMANNE HUSSEIN', 'text', 'JAMILA JUMANNE HUSSEIN', 'Technical issues;reliable internent connection is the main problem here,online student can access class wherever you have a connected device,but a stong internet connection is required.Low bandwidth and weak internet can affect how quick you can connect and participate in class(3)Motivation;online education environment require motivation to complete tasks,stay engaged and make progress .So when you\'re not surrounded by classmates and instructors in a physical setting,may descourage leaning environment of the student(4)Time management;most student found convenience and flexibility were the top reason to use online leaning.flexibility scheduling is the great for online student,but they often need it because of the other responsibility outside the school,such as work and family', '2020-12-21 09:16:31', ''),
(170, 'FB 0213', 'chat', 'IRENE CHARLES', 'text', 'IRENE CHARLES', ' The Flipped Classroom is a blended learning model in which traditional ideas about classroom activities and homework are reversed, or \"flipped.\" In this model, instructors have students interact with new material for homework first. They then use class time to discuss the new information and put those ideas into practice.', '2020-12-21 09:49:17', ''),
(171, 'FB 0213', 'chat', 'IRENE CHARLES', 'text', 'IRENE CHARLES', 'Biology has many concepts which needs proper illustration, explanation and practicals. Flipped classroom involves using online tools for pre-class interaction between the learner and the subject matter. ', '2020-12-21 09:52:12', ''),
